import { Typography } from "@mui/material";
import Box from "@mui/material/Box"
import Paper from "@mui/material/Paper";
import { DeviceListContext } from "../../State Management/DeviceListContext";


type deviceBigProps = {
    id: number;
}

export const DeviceBig = (props: deviceBigProps) => {
    return (
        <DeviceListContext.Provider value={props.id}>
            <Box>
                <Paper>
                    <Typography variant="h6">Device Name</Typography>
                    <Typography variant="h6">Ip Address</Typography>
                    <Typography variant="h6">Ping</Typography>
                </Paper>
            </Box>
        </DeviceListContext.Provider>
    )
}
